description:
I can't manage to upload the pdf version, sorry for that. But you can use an 

extension for firefox/chrome to read this book without installing another software.



You can buy it from here:
 &lt;a href=&quot;
http://www.amazon.com/Effective-JavaScript-Specific-Software-Development/dp/0321812182/ref=pd_sim_b_4&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.amazon.com/Effective-JavaScript-Specific-Software-Development/dp/0321812182/ref=pd_sim_b_4&lt;/a&gt;





Use this extension to read epub file on Firefox:
 &lt;a href=&quot;
https://addons.mozilla.org/en-US/firefox/addon/epubreader/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
https://addons.mozilla.org/en-US/firefox/addon/epubreader/&lt;/a&gt;



And use this extension to read epub file on Google Chrome:
 &lt;a href=&quot;
https://chrome.goog&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
https://chrome.goog&lt;/a&gt;
